import React from 'react';
import { Link } from 'react-router-dom';
import { Box, Button } from '@mui/material';

function NavBar({ user, onLogout }) {
  return (
    <Box sx={{ p: 2, bgcolor: '#f1f1f1', display: 'flex', justifyContent: 'space-between' }}>
      <Box>
        <Link to="/" style={{ marginRight: 12 }}>AppHome</Link>
        {user && <Link to="/dashboard" style={{ marginRight: 12 }}>Dashboard</Link>}
        {user && <Link to="/disclosure" style={{ marginRight: 12 }}>Disclosure</Link>}
      </Box>
      <Box>
  {user ? (
    <>
      <span style={{ marginRight: 12 }}>{user.name || user.email}</span>

      <Button
  variant="outlined"
  onClick={() => window.location.assign('http://localhost:6000/auth/logout')}
>
  Logout
</Button>

    </>
  ) : (
<Button
  variant="outlined"
  onClick={() => window.location.assign('http://localhost:6000/auth/login')}
>
  Login
</Button>
  )}
</Box>
    </Box>
  );
}

export default NavBar;
